{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/roryhargaden/cycle-case-study?scriptVersionId=153806644\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Cyclistic Ride-Share: A Trip Analysis\n### By Rory Hargaden","metadata":{}},{"cell_type":"markdown","source":"<center><img src = \"https://raw.githubusercontent.com/labwilliam/data_analysis_projects/main/cyclistic_bike_share/scripts/logo.png\" alt = \"logo\" width = \"50%\"/></center>","metadata":{}},{"cell_type":"markdown","source":"### Background\nIn 2016, Cyclistic launched as a bike-sharing program with much success. The program has blossomed since then, accumulating 5,824 bicycles that are geotracked and locked into 692 stations across Chicago. Cyclistic sets itself apart by offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n\nUntil now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments with flexible pricing plans:\n* single-ride passes\n* full-day passes\n* annual memberships\n\n\nHowever, Cyclistic’s finance team concluded that annual members are more profitable than casual riders. While the pricing tier helps Cyclistic draw more customers,the finance lead believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, it is believed there is a very good chance to convert casual riders into members.","metadata":{}},{"cell_type":"markdown","source":"### Business Task\n\nThe director of marketing feels the company's future success can be found in converting causal riders to annual members. It's up to our team to discover how casual riders and annual members differ in their use of Cyclistic bikes. Using these insights, the marketing team will create a new strategy focused on converting those causal riders to annual members. ","metadata":{}},{"cell_type":"markdown","source":"###  Questions To Consider\n\n1. How do annual members and casual riders use Cyclistic bikes    differently?\n2. Why would casual riders buy Cyclistic annual memberships?\n3. How can Cyclistic use digital media to influence casual        riders to become members?","metadata":{}},{"cell_type":"markdown","source":"### Data, Data Everywhere!\n\nFor the purposes of this case study, the trip data has been provided by Motivate International Inc. under license. License details can be found [here](http://https://divvybikes.com/data-license-agreement) The .csv formatted files contain trip data for the first six months of 2021. While a wealth of data was collected by the bikes including membership status, ride duration and geospatial coodinates; no personally identifying infomation was included. ","metadata":{}},{"cell_type":"markdown","source":"### Let's Get to Some Code!","metadata":{}},{"cell_type":"code","source":"# install and load packages\n\ninstall.packages(\"dplyr\")\ninstall.packages(\"tidyr\")\ninstall.packages(\"ggplot2\")\ninstall.packages(\"readr\")\ninstall.packages(\"lubridate\")\n\nlibrary(readr)\nlibrary(dplyr)\nlibrary(tidyr)\nlibrary(ggplot2)\nlibrary(lubridate)","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:42:44.612675Z","iopub.execute_input":"2023-12-06T02:42:44.614715Z","iopub.status.idle":"2023-12-06T02:45:24.552883Z"},"trusted":true},"execution_count":17,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nWarning message in install.packages(\"dplyr\"):\n“installation of package ‘dplyr’ had non-zero exit status”\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n\nAttaching package: ‘dplyr’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    filter, lag\n\n\nThe following objects are masked from ‘package:base’:\n\n    intersect, setdiff, setequal, union\n\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n","output_type":"stream"}]},{"cell_type":"code","source":"# import trip data\n\nJanuary_2021_Trip_Data <- read.csv(\"/kaggle/input/trip-data/202101-divvy-tripdata.csv\")\n\nFebruary_2021_Trip_Data <- read.csv(\"/kaggle/input/trip-data/202102-divvy-tripdata.csv\")\n\nMarch_2021_Trip_Data <- read.csv(\"/kaggle/input/trip-data/202103-divvy-tripdata.csv\")\n\nApril_2021_Trip_Data <- read.csv(\"/kaggle/input/trip-data/202104-divvy-tripdata.csv\")\n\nMay_2021_Trip_Data <- read.csv(\"/kaggle/input/trip-data/202105-divvy-tripdata.csv\")\n\nJune_2021_Trip_Data <- read.csv(\"/kaggle/input/trip-data/202106-divvy-tripdata.csv\")\n","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:08:06.571789Z","iopub.execute_input":"2023-12-06T02:08:06.574155Z","iopub.status.idle":"2023-12-06T02:08:57.599208Z"},"trusted":true},"execution_count":8,"outputs":[]},{"cell_type":"markdown","source":"After setting up my console and importing the data, I used the power of R to combine all six months of trip statistics. At this point I felt ready to noodle around with some high-level summaries. I'm not looking to make any insights; merely looking for outliers or anything out of the ordinary. It also helps determine which processing tasks need to take place before analysis. ","metadata":{}},{"cell_type":"code","source":"# combine all trip data into one\nAll_Trip_Data <- rbind(January_2021_Trip_Data,\n                       February_2021_Trip_Data,\n                       March_2021_Trip_Data,\n                       April_2021_Trip_Data,\n                       May_2021_Trip_Data,\n                       June_2021_Trip_Data)\n\n# run high-level summary for initial overview\nsummary(All_Trip_Data)\n\n\n# determine NA. This will help determine which variables are best suited for analysis\ncolSums(is.na(All_Trip_Data))\n\n# determine casual vs. member rides\ntable(All_Trip_Data$member_casual)","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:11:18.276336Z","iopub.execute_input":"2023-12-06T02:11:18.278488Z","iopub.status.idle":"2023-12-06T02:11:28.661791Z"},"trusted":true},"execution_count":9,"outputs":[{"output_type":"display_data","data":{"text/plain":"   ride_id          rideable_type       started_at          ended_at        \n Length:1973410     Length:1973410     Length:1973410     Length:1973410    \n Class :character   Class :character   Class :character   Class :character  \n Mode  :character   Mode  :character   Mode  :character   Mode  :character  \n                                                                            \n                                                                            \n                                                                            \n                                                                            \n start_station_name start_station_id   end_station_name   end_station_id    \n Length:1973410     Length:1973410     Length:1973410     Length:1973410    \n Class :character   Class :character   Class :character   Class :character  \n Mode  :character   Mode  :character   Mode  :character   Mode  :character  \n                                                                            \n                                                                            \n                                                                            \n                                                                            \n   start_lat       start_lng         end_lat         end_lng      \n Min.   :41.64   Min.   :-87.78   Min.   :41.51   Min.   :-88.07  \n 1st Qu.:41.88   1st Qu.:-87.66   1st Qu.:41.88   1st Qu.:-87.66  \n Median :41.90   Median :-87.64   Median :41.90   Median :-87.64  \n Mean   :41.90   Mean   :-87.64   Mean   :41.90   Mean   :-87.64  \n 3rd Qu.:41.93   3rd Qu.:-87.63   3rd Qu.:41.93   3rd Qu.:-87.63  \n Max.   :42.07   Max.   :-87.52   Max.   :42.15   Max.   :-87.49  \n                                  NA's   :1920    NA's   :1920    \n member_casual     \n Length:1973410    \n Class :character  \n Mode  :character  \n                   \n                   \n                   \n                   "},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<style>\n.dl-inline {width: auto; margin:0; padding: 0}\n.dl-inline>dt, .dl-inline>dd {float: none; width: auto; display: inline-block}\n.dl-inline>dt::after {content: \":\\0020\"; padding-right: .5ex}\n.dl-inline>dt:not(:first-of-type) {padding-left: .5ex}\n</style><dl class=dl-inline><dt>ride_id</dt><dd>0</dd><dt>rideable_type</dt><dd>0</dd><dt>started_at</dt><dd>0</dd><dt>ended_at</dt><dd>0</dd><dt>start_station_name</dt><dd>0</dd><dt>start_station_id</dt><dd>0</dd><dt>end_station_name</dt><dd>0</dd><dt>end_station_id</dt><dd>0</dd><dt>start_lat</dt><dd>0</dd><dt>start_lng</dt><dd>0</dd><dt>end_lat</dt><dd>1920</dd><dt>end_lng</dt><dd>1920</dd><dt>member_casual</dt><dd>0</dd></dl>\n","text/markdown":"ride_id\n:   0rideable_type\n:   0started_at\n:   0ended_at\n:   0start_station_name\n:   0start_station_id\n:   0end_station_name\n:   0end_station_id\n:   0start_lat\n:   0start_lng\n:   0end_lat\n:   1920end_lng\n:   1920member_casual\n:   0\n\n","text/latex":"\\begin{description*}\n\\item[ride\\textbackslash{}\\_id] 0\n\\item[rideable\\textbackslash{}\\_type] 0\n\\item[started\\textbackslash{}\\_at] 0\n\\item[ended\\textbackslash{}\\_at] 0\n\\item[start\\textbackslash{}\\_station\\textbackslash{}\\_name] 0\n\\item[start\\textbackslash{}\\_station\\textbackslash{}\\_id] 0\n\\item[end\\textbackslash{}\\_station\\textbackslash{}\\_name] 0\n\\item[end\\textbackslash{}\\_station\\textbackslash{}\\_id] 0\n\\item[start\\textbackslash{}\\_lat] 0\n\\item[start\\textbackslash{}\\_lng] 0\n\\item[end\\textbackslash{}\\_lat] 1920\n\\item[end\\textbackslash{}\\_lng] 1920\n\\item[member\\textbackslash{}\\_casual] 0\n\\end{description*}\n","text/plain":"           ride_id      rideable_type         started_at           ended_at \n                 0                  0                  0                  0 \nstart_station_name   start_station_id   end_station_name     end_station_id \n                 0                  0                  0                  0 \n         start_lat          start_lng            end_lat            end_lng \n                 0                  0               1920               1920 \n     member_casual \n                 0 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n casual  member \n 876479 1096931 "},"metadata":{}}]},{"cell_type":"markdown","source":"After running some basic summaries, I noticed a few obstacles which would prevent me from doing the best analysis as I can. Rides are logged in a date/time format which will need to be parsed out so I may analyze aspects like trip duration. Hundreds of thousands of trips are missing station names, which woiuld make determining popular stations and routes difficult. While its outside my wheelhouse as a junior analyst, I will attempt to use the geospatial coodinates to determine popular stations and routes. More on that later in the party. For now, lets get to changing some data types! ","metadata":{}},{"cell_type":"code","source":"# adjust datatypes and parse trip dates for analysis\nAll_Trip_Data$date <- as.Date(All_Trip_Data$started_at)\nAll_Trip_Data$month <- format(as.Date(All_Trip_Data$date), \"%m\")\nAll_Trip_Data$day_of_week <- format(as.Date(All_Trip_Data$date), \"%A\")\nAll_Trip_Data$ride_length <- difftime(All_Trip_Data$ended_at,All_Trip_Data$started_at)\n# difftime results in ride_length in seconds\n# formatting ride_length to minutes\nAll_Trip_Data$ride_length <- as.numeric(All_Trip_Data$ride_length/60)\n","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:31:32.294993Z","iopub.execute_input":"2023-12-06T02:31:32.298653Z","iopub.status.idle":"2023-12-06T02:31:50.990239Z"},"trusted":true},"execution_count":10,"outputs":[]},{"cell_type":"markdown","source":"After parsing the trip data, I doubled back to do some more summary work.","metadata":{}},{"cell_type":"code","source":"summary(All_Trip_Data$ride_length)\n# we received negative ride_lengths which affects averages\n# negative trip times are due to maintenance work\n# drop all entries with negative ride_length\nAll_Trip_Data <- All_Trip_Data[!(All_Trip_Data$ride_length<0),]\n# confirm all negative rides have been dropped\nsummary(All_Trip_Data$ride_length)\n\ntable(All_Trip_Data$day_of_week)\nAll_Trip_Data$day_of_week <- ordered(All_Trip_Data$day_of_week, levels=c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))\n\n\ntable(All_Trip_Data$month)\ntable(All_Trip_Data$rideable_type)\n# docked bike designated as assistive options","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:31:56.4973Z","iopub.execute_input":"2023-12-06T02:31:56.499336Z","iopub.status.idle":"2023-12-06T02:32:03.43306Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{"text/plain":"    Min.  1st Qu.   Median     Mean  3rd Qu.     Max. \n   -5.10     7.23    12.97    24.79    23.78 55944.15 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"    Min.  1st Qu.   Median     Mean  3rd Qu.     Max. \n    0.00     7.23    12.97    24.79    23.78 55944.15 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n   Friday    Monday  Saturday    Sunday  Thursday   Tuesday Wednesday \n   274813    251340    360284    321118    232628    267041    266170 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n    01     02     03     04     05     06 \n 96832  49622 228494 337225 531631 729590 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n classic_bike   docked_bike electric_bike \n      1207979        138817        626598 "},"metadata":{}}]},{"cell_type":"markdown","source":"### Let's Slow Things Down\n\nWow! It looks like we gained a lot of insight from those table summaries.\n* We were able to notice and correct negative trip durations. According to our documentation, negative trip durations are indicitive of maintenance work being performed. After eliminating those errant observations, we could accurately summarize trip length. \n* Our table summaries also show most trips take place on the weekends, as well as an increase in overall rides as the year progresses and gets warmer. This makes sense; it is Chicago after all! \n* It also showed a clear preference for the Classic Bike over Electric Bikes by nearly 2 to 1! As for Docked Bikes, which our documentation indicates are assistive options, make up a little over 7% of trips taken.\n\nSince my task is to discover the differences in riding habits between casual and member riders, I decided to get more granular with the trips.","metadata":{}},{"cell_type":"code","source":"# start viewing ride_length data more granularly\naggregate(All_Trip_Data$ride_length ~ All_Trip_Data$member_casual, FUN = max) #longest trip\naggregate(All_Trip_Data$ride_length ~ All_Trip_Data$member_casual, FUN = mean) #average trip\naggregate(All_Trip_Data$ride_length ~ All_Trip_Data$member_casual, FUN = min) #minimum trip\n\naggregate(All_Trip_Data$ride_length ~ All_Trip_Data$member_casual + All_Trip_Data$rideable_type, FUN = mean)\n# ride length based on membership and bike type\n\ntable(All_Trip_Data$rideable_type, All_Trip_Data$member_casual)\n# which user prefers which bike?\n","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:34:33.31159Z","iopub.execute_input":"2023-12-06T02:34:33.314109Z","iopub.status.idle":"2023-12-06T02:34:44.163312Z"},"trusted":true},"execution_count":13,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 2 × 2</caption>\n<thead>\n\t<tr><th scope=col>All_Trip_Data$member_casual</th><th scope=col>All_Trip_Data$ride_length</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>55944.150</td></tr>\n\t<tr><td>member</td><td> 1559.933</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 2 × 2\n\n| All_Trip_Data$member_casual &lt;chr&gt; | All_Trip_Data$ride_length &lt;dbl&gt; |\n|---|---|\n| casual | 55944.150 |\n| member |  1559.933 |\n\n","text/latex":"A data.frame: 2 × 2\n\\begin{tabular}{ll}\n All\\_Trip\\_Data\\$member\\_casual & All\\_Trip\\_Data\\$ride\\_length\\\\\n <chr> & <dbl>\\\\\n\\hline\n\t casual & 55944.150\\\\\n\t member &  1559.933\\\\\n\\end{tabular}\n","text/plain":"  All_Trip_Data$member_casual All_Trip_Data$ride_length\n1 casual                      55944.150                \n2 member                       1559.933                "},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 2 × 2</caption>\n<thead>\n\t<tr><th scope=col>All_Trip_Data$member_casual</th><th scope=col>All_Trip_Data$ride_length</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>37.59201</td></tr>\n\t<tr><td>member</td><td>14.56783</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 2 × 2\n\n| All_Trip_Data$member_casual &lt;chr&gt; | All_Trip_Data$ride_length &lt;dbl&gt; |\n|---|---|\n| casual | 37.59201 |\n| member | 14.56783 |\n\n","text/latex":"A data.frame: 2 × 2\n\\begin{tabular}{ll}\n All\\_Trip\\_Data\\$member\\_casual & All\\_Trip\\_Data\\$ride\\_length\\\\\n <chr> & <dbl>\\\\\n\\hline\n\t casual & 37.59201\\\\\n\t member & 14.56783\\\\\n\\end{tabular}\n","text/plain":"  All_Trip_Data$member_casual All_Trip_Data$ride_length\n1 casual                      37.59201                 \n2 member                      14.56783                 "},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 2 × 2</caption>\n<thead>\n\t<tr><th scope=col>All_Trip_Data$member_casual</th><th scope=col>All_Trip_Data$ride_length</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>0</td></tr>\n\t<tr><td>member</td><td>0</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 2 × 2\n\n| All_Trip_Data$member_casual &lt;chr&gt; | All_Trip_Data$ride_length &lt;dbl&gt; |\n|---|---|\n| casual | 0 |\n| member | 0 |\n\n","text/latex":"A data.frame: 2 × 2\n\\begin{tabular}{ll}\n All\\_Trip\\_Data\\$member\\_casual & All\\_Trip\\_Data\\$ride\\_length\\\\\n <chr> & <dbl>\\\\\n\\hline\n\t casual & 0\\\\\n\t member & 0\\\\\n\\end{tabular}\n","text/plain":"  All_Trip_Data$member_casual All_Trip_Data$ride_length\n1 casual                      0                        \n2 member                      0                        "},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 6 × 3</caption>\n<thead>\n\t<tr><th scope=col>All_Trip_Data$member_casual</th><th scope=col>All_Trip_Data$rideable_type</th><th scope=col>All_Trip_Data$ride_length</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>classic_bike </td><td>31.587404</td></tr>\n\t<tr><td>member</td><td>classic_bike </td><td>14.967082</td></tr>\n\t<tr><td>casual</td><td>docked_bike  </td><td>90.707784</td></tr>\n\t<tr><td>member</td><td>docked_bike  </td><td> 2.633333</td></tr>\n\t<tr><td>casual</td><td>electric_bike</td><td>21.614957</td></tr>\n\t<tr><td>member</td><td>electric_bike</td><td>13.645566</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 6 × 3\n\n| All_Trip_Data$member_casual &lt;chr&gt; | All_Trip_Data$rideable_type &lt;chr&gt; | All_Trip_Data$ride_length &lt;dbl&gt; |\n|---|---|---|\n| casual | classic_bike  | 31.587404 |\n| member | classic_bike  | 14.967082 |\n| casual | docked_bike   | 90.707784 |\n| member | docked_bike   |  2.633333 |\n| casual | electric_bike | 21.614957 |\n| member | electric_bike | 13.645566 |\n\n","text/latex":"A data.frame: 6 × 3\n\\begin{tabular}{lll}\n All\\_Trip\\_Data\\$member\\_casual & All\\_Trip\\_Data\\$rideable\\_type & All\\_Trip\\_Data\\$ride\\_length\\\\\n <chr> & <chr> & <dbl>\\\\\n\\hline\n\t casual & classic\\_bike  & 31.587404\\\\\n\t member & classic\\_bike  & 14.967082\\\\\n\t casual & docked\\_bike   & 90.707784\\\\\n\t member & docked\\_bike   &  2.633333\\\\\n\t casual & electric\\_bike & 21.614957\\\\\n\t member & electric\\_bike & 13.645566\\\\\n\\end{tabular}\n","text/plain":"  All_Trip_Data$member_casual All_Trip_Data$rideable_type\n1 casual                      classic_bike               \n2 member                      classic_bike               \n3 casual                      docked_bike                \n4 member                      docked_bike                \n5 casual                      electric_bike              \n6 member                      electric_bike              \n  All_Trip_Data$ride_length\n1 31.587404                \n2 14.967082                \n3 90.707784                \n4  2.633333                \n5 21.614957                \n6 13.645566                "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"               \n                casual member\n  classic_bike  442449 765530\n  docked_bike   138816      1\n  electric_bike 295210 331388"},"metadata":{}}]},{"cell_type":"markdown","source":"Lots of valuable data off that code chunk!\n* Average ride length for a casual rider is nearly twice that     of a member. The interesting outlier comes from bike type.     Ride length for an assistive bike is twice as long as the       casual rider on a Classic Bike and nearly four times as long   as electric! While the overall rides are roughly 7% of the       total taken, this statistic is worth considering while I       continue analysis.\n* Longest trips for both casual and member riders were           Saturday and Sunday. Second-longest for both is Monday and     Friday. This seems to jive with Chicago being both a tourist   destination.\n* The assistive Docked Bikes are almost exclusively used by       casual riders. Only 1 trip by a member used an assistive       bike.","metadata":{}},{"cell_type":"markdown","source":"I feel we have come as far as possible generating tables and summaries. As great as they've been at providing valuable insight as an analyst, I need to be able to back that data up with visuals that will drive home my analysis. I've selected some data points to highlight visually for the marketing presentation. ","metadata":{}},{"cell_type":"markdown","source":"### Let's Get to Plotting!","metadata":{}},{"cell_type":"code","source":"subscribe <- table(All_Trip_Data$member_casual)\n\n  lbls <- c(\"Member\", \"Casual\")\n  pct <- round(subscribe/sum(subscribe)*100)\n  lbls <- paste(lbls, pct)\n  # add percents to labels\n  lbls <- paste(lbls,\"%\",sep=\"\") # ad % to labels\n  pie(subscribe,labels = lbls, col=rainbow(length(lbls)),\n      main=\"Ridership Breakdown\", radius = 1)\n\n# thanks to statmethods.net for help on the pie chart\n","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:45:43.409975Z","iopub.execute_input":"2023-12-06T02:45:43.4128Z","iopub.status.idle":"2023-12-06T02:45:43.684184Z"},"trusted":true},"execution_count":18,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3RT9f/H8fdNuhctLatsKCCzlFFkCIg4UbYDFBRwgCwX4gBFEQUFZbjwy09l\nCCogKCoCCqjssqmsMsospS2dlI7k3t8fKaEUKC3r3tw+H0fPSW9u7n3lhjSvfu6IommaAAAA\nwPVZ9A4AAACAG4NiBwAAYBIUOwAAAJOg2AEAAJgExQ4AAMAkKHYAAAAmQbEDAAAwCYodAACA\nSVDsAAAATIJiBwAAYBIUOwAAAJOg2AEAAJgExQ4AAMAkKHYAAAAmQbEDAAAwCYodAACASVDs\nAAAATIJiBwAAYBIUOwAAAJOg2AEAAJgExQ4AAMAkKHYAAAAmQbEDAAAwCYodAACASVDsAAAA\nTIJiBwAAYBIUOwAAAJOg2AEAAJgExQ4AAMAkKHYAAAAmQbEDAAAwCYodAACASVDsAAAATIJi\nBwAAYBIUOwAAAJOg2AEAAJgExQ4AAMAkKHYAAAAmQbEDAAAwCYod4KrU3FPKlVksHkFlqt7V\nY9Cvu1PyPyp+44POeWKz7YWvwnZur3PmzjsSbuazuaJiBS7WzEV3pY3s4e1foUajrk+NWPZf\n8o1a17VZ2+82RyTvoI7X8HAjvNAAbgiKHWBOmpabknh05U9fdm1ca8YenWuHWeVmZZw6vOvn\nmRMfCK/64ty9escBAIodYHb23MSX7nlZ7xQmp9rTp/ZtvjA+U+8gAEo6ih1gBhVaz0/MJz7u\n+PqfP6/u5ea4N/34NwsTzzlul202zzlbFU+rfpFvipv97ErXmZl/M+/fFfXJy3m7PlV7xsjh\nG274GgGgWNz0DgDgBrC4+wcHB+efUrbzoAUjvmo6drvjx5+TsnqEeIuIYvW/eEZTudnPzmIN\nyL+dg4PLvjBxxb8zfX9KzBSRhA1/i3S4iasHgKthxA4wrXJ3lrt0YiGnF5w9vuaVfp2rhwZ7\nePlXq99m5NSlqqZdaeEJO3574amudapW8PX0Kl+1Ttv7ev9vSVT+xf035XbHWqzupUUkft3c\nnm0alfb2OHJhpdra76f2ur9t1XKlvdzd/YNCGkTeOeydzw5k5BbypPYumdK1Tf2QAK+g0Jpt\n73v829VHCn92q7rVcPzoW+Zh0bJnvzu4cY2KPh4+FWs0eGLYO1EnbsDOUx+L4rjhFVyn6E//\nqhvQQVMzF33+7kPtIyuGBHq6ufv4B4Y1bNF3+Dsbj5+9arCETVMD3KyOGLf1muJceLFeaM12\nZv6U0V3aNwktE+jh4V0mtEq7h5745Id/bfkeMS4syLGWgMoXdvqf3vK487V4YuuFEzKa+ns6\nJla9/7dLN9SG2ePua16ntL+Xt39Qw9b3fzRv01WfJoCLaABckz0nzvlGrtj+j0tniHo93DnD\n8uQsx8RTGzo5Jx7Osjlnjl83rYJHwX2XjZ8Z57z90PbTzplXfvyku6Jc+vukSofnj2XnLTN6\ncgvHRItbUOLWqUFulotWqma/07XOpUsQEY+A2+ZEn3GuK3