7TfTr1rWUrjx5tufceUFoytSvVTRhbyCgZcev9uds6b9enHz0M1GHHf+tLGbVHz2\naddHXfZbSNsnXfZbSNFy+i3ot5Vksd9GlORn8cTXyDrqt88+M3QrkUyus6/1JIQQQjLZXFWb\nHNi/ONuF0FdoOXqTfoOcItgBAERifXnPAwAA3RDsAAAiIdgBAERCsAMAiIRgBwAQCcEOACAS\ngh0AQCQEOwCASAh2AACREOwAACIh2AEAROL/AbeVIq1C9OqsAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"#### Analysis\nIt was imortant for me to include at least one visual breaking down bike types between casual and member riders. As the bar chart clearly shows, nearly all assistive riders are not members. This data point was discovered early in our analysis. I think the marketing department could seek out the users with limited mobility with a survey. Are they not members because there are too few assisted bikes? Are they in the wrong locations? Understanding these insights could convert a small, but important and often underserved demographic.\n","metadata":{}},{"cell_type":"markdown","source":"### Extra Credit: Where Did They Go?","metadata":{}},{"cell_type":"code","source":"install.packages(\"ggmap\")\nlibrary(ggmap)\nregister_stadiamaps(key = \"9a33bd50-6156-459b-8b98-554f44153e81\", write = TRUE)\ncoordinates <- All_Trip_Data %>%\n  filter(start_lng != end_lng & start_lat != end_lat) %>%\n  group_by(start_lng, start_lat, end_lng, end_lat, member_casual, rideable_type) %>%\n  summarise(total = n(),.groups=\"drop\") %>%\n  filter(total > 100)\n\ncasual <- coordinates %>% filter(member_casual == \"casual\")\nmember <- coordinates %>% filter(member_casual == \"member\")\n\n#Lets store bounding box coordinates for ggmap:\nchi_bb <- c(\n  left = -87.670424,\n  bottom = 41.780769,\n  right = -87.574855,\n  top = 41.92\n)\n\n#Here we store the stamen map of Chicago\nchicago_stamen <- get_stadiamap(\n  bbox = chi_bb,\n  zoom = 10,\n  maptype = \"outdoors\"\n)\n\nggmap(chicago_stamen,darken = c(0.4, \"white\")) +\n  geom_line(casual, mapping = aes(x = start_lng, y = start_lat, alpha= total, color=rideable_type), size = 1.5,arrow = arrow(length=unit(0.2,\"cm\"), ends=\"first\", type = \"closed\")) +\n  coord_equal() +\n  labs(title = \"Popular Routes By Casual Users\",x=NULL,y=NULL, color=\"User type\") +\n  theme(legend.position=\"none\")\n\nggmap(chicago_stamen,darken = c(0.4, \"white\")) +\n  geom_line(member, mapping = aes(x = start_lng, y = start_lat, alpha= total, color=rideable_type), size = 0.5,arrow = arrow(length=unit(0.2,\"cm\"), ends=\"first\", type = \"closed\")) +\n  coord_fixed() +\n  labs(title = \"Popular Routes By Annual Members\",x=NULL,y=NULL) +\n  theme(legend.position=\"none\")\n","metadata":{"execution":{"iopub.status.busy":"2023-12-06T02:56:34.975558Z","iopub.execute_input":"2023-12-06T02:56:34.97774Z","iopub.status.idle":"2023-12-06T02:57:14.198442Z"},"trusted":true},"execution_count":24,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n\u001b[36mℹ\u001b[39m Creating file /root/.Renviron\n\n\u001b[36mℹ\u001b[39m Adding key to /root/.Renviron\n\n\u001b[36mℹ\u001b[39m © Stadia Maps © Stamen Design © OpenMapTiles © OpenStreetMap contributors.\n\nWarning message:\n“\u001b[1m\u001b[22mUsing `size` aesthetic for lines was deprecated in ggplot2 3.4.0.\n\u001b[36mℹ\u001b[39m Please use `linewidth` instead.”\n\u001b[1m\u001b[22mCoordinate system already present. Adding new coordinate system, which will\nreplace the existing one.\nWarning message:\n“\u001b[1m\u001b[22mRemoved 20 rows containing missing values (`geom_line()`).”\n\u001b[1m\u001b[22mCoordinate system already present. Adding new coordinate system, which will\nreplace the existing one.\nWarning message:\n“\u001b[1m\u001b[22mRemoved 34 rows containing missing values (`geom_line()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOy9ebxlV1UtPMZc595bXVLpQxJCIB0QCN0LoQ1BkF4wCgj4HiCKiBBAgQdBiEor\noAalR8DmSePnQ+kEpI