pjLa5lV3fDJtV6XcrVJvulHNfnR+ZOWufutgz\nacvMZa7/vxLcdFjREJHbZa7eW89vfq5+X9nCro6VWnC3GaJWLB1WjaB2/AhuOksWgvd01I6g\nuKqqqlv9NwCEBv629O87T3b0GlffHmWbMHad0Df2XivYV54e47kCDra/f3Yo7ZmCm97wdPWT\n5o7ewfUZWiKSSHmttU+vP8Wr1asso2eOHvh8wKx7tVSjTulua+24aIpXR5mvXzO0HOj81bXn\nlZI4Xp7qutTacjJWkxpmMR6reXOIz9pfvHHxM2kQcDqsaBIUMvOfjQ2f/pyfv3lqxDg8a2Rc\nuTYl3XdqeBeXF+HSIQnnu0ZY52/F9v/jAkxHHp3kvxC8py85BQKBFxQD/AO2if7Ghua+X66O\nTXPxiclbCsseyZz/GKp/orD7rr36ysyFU77dVXzQFH/82BueY7fj1Me1x0/3jFrliZq0R0t2\n5Wijicg6/uOHDUe7Ll2xcJFJKffkPVl239oIIiK309B0sNXQM2aRaDKyy/c8nRyOOyh8CzQd\nRjTG8xVlNT/c/KsoKuHl5roNzNTAi0DpELFrBLWzbAGm478QfE5H7QgHjR0AAACASOAeOwAA\nAACRQGMHAAAAIBJo7AAAAABEAo0dAAAAgEigsQMAAAAQCTR2AAAAACKBxg4AAABAJNDYAQAA\nAIgEGjsAAAAAkUBjBwAAACASaOwAAAAAROJv6etwXlACeZAAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"#### Analysis\nI wanted to see what types of secrets plotting the 100 most common routes on a map of Chicago would reveal. The routes for members tended towards an even spread throughout the city, with obvious density at the heart of downtown. Casual riders travelled primarily downtown or northside of the city. Chicago is a tourist town which could account for some of this traffic. However, it is liklely some of these are commuters; a new possible source for membership. We could suggest the marketing department target large companies within this region for partnerships or discounted rates.","metadata":{}},{"cell_type":"markdown","source":"### Conclusion\nHave we completed our business task by answering the questions provided?\n\n**How do annual members and casual riders use Cyclistic bikes differently?** Casual riders had an average duration twice that of member riders. All except for 1 assistive ride was taken by a casual rider. Members tend to take their most trips midweek while casual riders on the weekends.\n\n**Why would casual riders buy Cyclistic annual memberships?**\nFocus on the cost and ease of use of the program. 56% of all rides were casual riders yet they took longer trips. This could indicate most are interested in the most bang for their buck. The marketing team could highlight how cost effective an annual membership would be while giving the user more freedom to take multiple trips. \n\n**How can Cyclistic use digital media to influence casual riders to become members?**\nWe could reach out to downtown businesses and offer discounts to their employees or a possible group rate where the business pays a percentage. Further, we could collaborate with nonprofits who assist individuals who have mobility issues. Since all but 1 trip that used an assisted bike was taken by a casual rider, we could increase awareness of our services in this community.","metadata":{}},{"cell_type":"markdown","source":"### Thank You For Your Interest In My Project!","metadata":{}},{"cell_type":"markdown","source":"### References used in the creation of this project:\n1. https://www.kaggle.com/code/julenaranguren/cyclistic-bike-share-a-case-study#PHASE-5-:-Share (for guidance on the geospatial coordinates and the map of Chicago)\n2. https://www.statology.org/ggplot-pie-chart/ (excellent tips for customizing my pie chart. Displaying percentages was super critical to my analysis)\n3. https://stackoverflow.com/ (general help with data types)\n4. https://www.rstudio.com/wp-content/uploads/2015/02/rmarkdown-cheatsheet.pdf (fantastic cheatsheet for markdowns)","metadata":{}}]}